import React from 'react';
import {DateInput} from './components/DateInput';
import {Favorites} from './components/Favorites';
import {Launches} from './components/Launches';
import './App.scss';
function App() {
  return (
    <div className="app">
      <h1>Launches</h1>
      <DateInput />
      <Favorites favorites={[]}/>
      <Launches launches={[]}/>
    </div>
  );
}

export default App;
